INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(1, 'What\'s to know about viral hepatitis A?', 'John', 'Hepatic', 'The Centers for Disease Control and Prevention (CDC) estimate that there are around 6,700 new hepatitis A infections each year in the United States.\r\n\r\nOverall, the number of U.S. cases has declined during the past 20 years — largely due to immunization — but outbreaks do sometimes occur.\r\n\r\nHepatitis A usually transmits through contaminated food or water. It is common in many countries, especially those that do not have effective sanitation systems.\r\n\r\nSymptoms include:\r\n\r\njaundice\r\nabdominal pain\r\nnausea\r\nlow appetite\r\nHowever, many people do not experience symptoms at all. Those who do usually make a full recovery within a few weeks to several months. After this, they have immunity to it. Children under 6 years do not usually show any symptoms.\r\n\r\nIn rare cases, hepatitis A can be fatal. However, there are safe and effective vaccines that protect against this virus.\r\n\r\nTreatment\r\nThere is no cure for hepatitis A, but treatment can help manage symptoms. Avoiding alcohol can help with recovery, but most people recover without intervention.', '2020-09-22 09:32:52', , 1);
INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(2, 'What\'s to know about viral hepatitis B?', 'Johnny', 'Hepatic', 'Hepatitis B\r\nInfection with hepatitis B is usually acute, or short-term, but it can become chronic — especially in children.\r\n\r\nLong-term complications, such as liver cancer or cirrhosis, can affect around 15–25% of people with chronic hepatitis B. There is no cure, but treatment can help manage the condition.\r\n\r\nThe CDC estimate that in the U.S., around 862,000 people are currently living with hepatitis B.\r\n\r\nThe virus can transmit through:\r\n\r\nhaving unprotected sexual intercourse\r\nsharing needles\r\nhaving a tattoo with unsterilized needles\r\nsustaining accidental skin pricks with medical equipment\r\nsharing personal items, such as a toothbrush or razor\r\nbreastfeeding, if the mother has the virus\r\nThe symptoms are similar to those of other types of hepatitis. They include abdominal pain and jaundice.\r\n\r\nA safe and effective vaccine is available that can protect people from hepatitis B infection. The number of cases has fallen dramatically in countries where the vaccine is available.\r\n\r\nTreatment\r\nThere is no cure for hepatitis B, but supportive care can help manage symptoms. In cases of chronic illness, a doctor may prescribe antiviral medication, and they will monitor the liver regularly to check for damage over time.\r\n\r\nA person should also avoid alcohol during treatment and recovery.', '2020-09-22 09:32:56', , 1);
INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(3, 'What\'s to know about viral hepatitis C?', 'Mike', 'Hepatic', 'Hepatitis C\r\nHepatitis C is a blood-borne virus that usually transmits through sharing needles or other drug-related equipment.\r\n\r\nOther people who may be at risk include healthcare workers who handle sharps and children whose mothers have the virus.\r\n\r\nIt can be a short-term condition, but up to 85% of people will develop a chronic, long-term infection.\r\n\r\nA person may have no symptoms, and around half of people living with the virus do not know they have it. They may transmit it to another person without realizing it.\r\n\r\nThe CDC estimate that there are around 44,300 new cases of hepatitis C each year, and that around 2.4 million people are currently living with this virus in the U.S. The number has been growing since 2010.\r\n\r\nTreatment\r\nIn around 25% of people, the body will eliminate the virus over time. In others, however, it can remain in the body and become chronic.\r\n\r\nAccording to the CDC, a doctor will not treat hepatitis C unless chronic hepatitis develops. Then, they may prescribe a course of oral medication for 8–12 weeks, after which 9 out of 10 people will no longer have symptoms.\r\n\r\nCombination therapy can eliminate the virus in some people with certain strains of the virus.\r\n\r\nAs with other types of hepatitis, people who have hepatitis C should avoid alcohol.', '2020-09-22 09:32:59', , 1);
INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(5, 'General recommendations for cleaning and disinfection of households with people isolated in home care (e.g. suspected/confirmed to have COVID-19)', 'Steve', 'covid', 'Household members should educate themselves about COVID-19 symptoms and preventing the spread of COVID-19 in homes.\r\nClean and disinfect high-touch surfaces daily in household common areas (e.g. tables, hard-backed chairs, doorknobs, light switches, phones, tablets, touch screens, remote controls, keyboards, handles, desks, toilets, sinks)\r\nIn the bedroom/bathroom dedicated for an ill person: consider reducing cleaning frequency to as-needed (e.g., soiled items and surfaces) to avoid unnecessary contact with the ill person.\r\nAs much as possible, an ill person should stay in a specific room and away from other people in their home, following home care guidance.\r\nThe caregiver can provide personal cleaning supplies for an ill person’s room and bathroom, unless the room is occupied by child or another person for whom such supplies would not be appropriate. These supplies include tissues, paper towels, cleaners and EPA-registered disinfectants (see examplesexternal icon).\r\nIf a separate bathroom is not available, the bathroom should be cleaned and disinfected after each use by an ill person. If this is not possible, the caregiver should wait as long as practical after use by an ill person to clean and disinfect the high-touch surfaces.\r\nHousehold members should follow home care guidance when interacting with persons with suspected/confirmed COVID-19 and their isolation rooms/bathrooms.\r\nHow to clean and disinfect\r\nHard (Non-porous) Surfaces\r\nWear disposable gloves when cleaning and disinfecting surfaces. Gloves should be discarded after each cleaning. If reusable gloves are used, those gloves should be dedicated for cleaning and disinfection of surfaces for COVID-19 and should not be used for other purposes. Consult the manufacturer’s instructions for cleaning and disinfection products used. Clean hands immediately after gloves are removed.\r\nIf surfaces are dirty, they should be cleaned using a detergent or soap and water prior to disinfection.\r\nAlways read and follow the directions on the label to ensure safe and effective use.\r\n\r\nWear skin protection and consider eye protection for potential splash hazards\r\nEnsure adequate ventilation\r\nUse no more than the amount recommended on the label\r\nUse water at room temperature for dilution (unless stated otherwise on the label)\r\nAvoid mixing chemical products\r\nLabel diluted cleaning solutions\r\nStore and use chemicals out of the reach of children and pets\r\nYou should never eat, drink, breathe or inject these products into your body or apply directly to your skin as they can cause serious harm. Do not wipe or bathe pets with these products or any other products that are not approved for animal use.\r\n\r\nSee EPA’s 6 steps for Safe and Effective Disinfectant Useexternal icon\r\n\r\nSpecial considerations should be made for people with asthma and they should not be present when cleaning and disinfecting is happening as this can trigger asthma exacerbations. To learn more about reducing asthma triggers: https://www.cdc.gov/asthma/reduce_triggers.html\r\n\r\nA list of disinfectant products that are EPA-approved for use against the virus that causes COVID-19 is available hereexternal icon. Follow the manufacturer’s instructions for all cleaning and disinfection products. Read the product label for the correct concentration to use, application method, and contact time.\r\nDiluted household bleach solutions can be used if appropriate for the surface. Unexpired household bleach will be effective against coronaviruses when properly diluted:\r\nUse bleach containing 5.25%–8.25% sodium hypochlorite. Do not use a bleach product if the percentage is not in this range or is not specified.\r\nFollow the manufacturer’s application instructions for the surface, ensuring a contact time of at least 1 minute.\r\nEnsure proper ventilation during and after application.\r\nCheck to ensure the product is not past its expiration date.\r\nNever mix household bleach with ammonia or any other cleanser. This can cause fumes that may be very dangerous to breathe in.\r\nPrepare a bleach solution by mixing:\r\n5 tablespoons (1/3rd cup) of 5.25–8.25% bleach per gallon of room temperature water or\r\n4 teaspoons of 5.25–8.25% bleach per quart of room temperature water\r\nBleach solutions will be effective for disinfection up to 24 hours.\r\nAlcohol solutions with at least 70% alcohol may also be used.\r\nSoft (Porous) Surfaces\r\nFor soft (porous) surfaces such as carpeted floor, rugs, and drapes, remove visible contamination if present and clean with appropriate cleaners indicated for use on these surfaces. After cleaning:\r\nLaunder items as appropriate in accordance with the manufacturer’s instructions. If possible, launder items using the warmest appropriate water setting for the items and dry items completely.\r\nOtherwise, use products that are EPA-approved for use against the virus that causes COVID-19external icon and that are suitable for porous surfaces.\r\nElectronics\r\nFor electronics such as cell phones, tablets, touch screens, remote controls, and keyboards, remove visible contamination if present.\r\nFollow the manufacturer’s instructions for all cleaning and disinfection products.\r\nConsider use of wipeable covers for electronics.\r\nIf no manufacturer guidance is available, consider the use of alcohol-based wipes or sprays containing at least 70% alcohol to disinfect touch screens. Dry surfaces thoroughly to avoid pooling of liquids.\r\nLinens, clothing, and other items that go in the laundry\r\nWear disposable gloves when handling dirty laundry from an ill person and then discard after each use. If using reusable gloves, those gloves should be dedicated for cleaning and disinfection of surfaces for COVID-19 and should not be used for other household purposes. Clean hands immediately after gloves are removed.\r\nIf no gloves are used when handling dirty laundry, be sure to wash hands afterwards.\r\nIf possible, do not shake dirty laundry. This will minimize the possibility of dispersing virus through the air.\r\nLaunder items as appropriate in accordance with the manufacturer’s instructions. If possible, launder items using the warmest appropriate water setting for the items and dry items completely. Dirty laundry from an ill person can be washed with other people’s items.\r\nClean and disinfect clothes hampers according to guidance above for surfaces. If possible, consider placing a bag liner that is either disposable (can be thrown away) or can be laundered.\r\nHand hygiene and other preventive measures\r\nHousehold members should clean hands often, including immediately after removing gloves and after contact with an ill person, by washing hands with soap and water for 20 seconds. If soap and water are not available and hands are not visibly dirty, an alcohol-based hand sanitizer that contains at least 60% alcohol may be used. However, if hands are visibly dirty, always wash hands with soap and water.\r\nAlways read and follow the directions on the label to ensure safe and effective use.\r\n\r\nKeep hand sanitizers away from fire or flame\r\nFor children under six years of age, hand sanitizer should be used with adult supervision\r\nAlways store hand sanitizer out of reach of children and pets\r\nSee FDA’s Tips for Safe Sanitizer Useexternal icon and CDC’s Hand Sanitizer Use Considerations\r\n\r\nHousehold members should follow normal preventive actions while at work and home including recommended hand hygiene and avoiding touching eyes, nose, or mouth with unwashed hands.\r\nAdditional key times to clean hands include:\r\nAfter blowing one’s nose, coughing, or sneezing\r\nAfter using the restroom\r\nBefore eating or preparing food\r\nAfter contact with animals or pets\r\nBefore and after providing routine care for another person who needs assistance (e.g. a child)\r\nOther considerations\r\nThe ill person should eat/be fed in their room if possible. Non-disposable food service items used should be handled with gloves and washed with hot water or in a dishwasher. Clean hands after handling used food service items.\r\nIf possible, dedicate a lined trash can for the ill person. Use gloves when removing garbage bags, handling, and disposing of trash. Wash hands after handling or disposing of trash.\r\nConsider consulting with your local health department about trash disposal guidance if available.', '2020-09-22 09:33:02', , 1);
INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(6, 'Study Reveals How Coronavirus Travels Indoors', 'Ryan', 'covid', 'A new study explains how the coronavirus hitches a ride on droplets released when you cough, sneeze, talk or speak, and travels around a room.\r\n\r\n       \r\n\r\nThe University of Minnesota scientists hope their work will help schools and businesses take steps to reduce the chance of COVID-19 transmission as they reopen.\r\n\r\n       \r\n\r\nFor the study, they created a model of how these aerosols travel in indoor spaces such rooms, elevators and supermarkets. They also compared how the virus did in various types of ventilation and with different spacing of people within a room.\r\n\r\n       \r\n\r\n\"You see a lot of people talking about what the risks are of staying in confined spaces, but nobody gives a quantitative number,\" said co-author Jiarong Hong, an associate professor of mechanical engineering.\r\n\r\n       \r\n\r\n\"I think the major contribution we\'ve made is combining very accurate measurements and computational fluid dynamics simulation to provide a very quantitative estimate of the risks,\" he said in a university news release.\r\n\r\n       \r\n\r\nResearchers found that good ventilation can filter out some of the virus, but can leave it on surfaces.\r\n\r\n       \r\n\r\nIn a classroom setting, they ran a simulation in which an asymptomatic teacher talked for 50 minutes straight. It found that only 10% of aerosols were filtered out. Most of the particles remained on the walls.\r\n\r\n       \r\n\r\n\"Because this is very strong ventilation, we thought it would ventilate out a lot of aerosols. But 10% is really a small number,\" said co-author Suo Yang, an assistant professor of mechanical engineering.\r\n\r\n       \r\n\r\nHe noted that the ventilation forms vortexes -- expelled aerosols rotate within those vortexes rather than exiting, he said.\r\n\r\n       \r\n\r\n\"When they collide with the wall, they attach to the wall,\" Yang added. \"But, because they are basically trapped in this vortex, and it\'s very hard for them to reach the vent and actually go out.\"\r\n\r\n       \r\n\r\nThe researchers followed the airflow to find virus hot spots where the aerosols congregated in the room. They also found, for example, that the aerosols spread significantly less throughout the space when the teacher was placed directly under an air vent.', '2020-09-22 09:33:06', , 1);
INSERT INTO `blog` (`id`, `title`, `author`, `category`, `body`, `date`, `image`, `approval`) VALUES
(7, 'These are the everyday objects to be wary of touching as the coronavirus spreads, and how to adapt', 'Mike', 'covid', 'The coronavirus is mainly transmitted by droplets from the bodily fluids of people with the disease. The virus can survive this way on surfaces for a long time — which poses a challenge for everyday life.\r\n\r\nScientists still don\'t think surfaces are the main way the virus spreads, but it is possible to catch the virus by touching a surface with the virus there, then touching your face, according to the US CDC. \r\n\r\nEngland\'s Deputy Chief Medical Officer, Dr Jenny Harries, told the BBC in March that the coronavirus can live on soft surfaces for 24 hours, and hard ones for 48 hours.\r\n\r\nMore recently, The Guardian reported on a new study by The New England Journal of Medicine from March 17. It found the coronavirus lasted on plastic and steel for up to 72 hours, cardboard for up to 24 hours, and copper for up to four hours. \r\n\r\nHere are the objects to be wary of, and what to do minimize the chance of catching the coronavirus. \r\n\r\nGroceries and packages\r\nA delivery driver wearing a face mask delivers groceries to a home on March 30, 2020.\r\nA delivery driver wearing a face mask delivers groceries to a home on March 30, 2020. Mark Baker / AP\r\nHarvard Medical School infectious disease epidemiologist and professor Dr. Julia Marcus told The Guardian there was a low risk of infection from groceries and delivered goods. \r\n\r\nShe said the transmission was possible if the deliverer was sick. The best practice was to be wary whenever something new entered your house and to wash your hands after dealing with it.\r\n\r\nCellphones\r\nA person shows a man a news story on their phone.\r\nA person shows a man a news story on their phone. Julio Cortez / AP\r\nAccording to Quartz, in 2019, the number of mobile phones in the world took over the global population.\r\n\r\nBusiness Insider reported in March that a smartphone carries more germs and bacteria than a toilet seat — an obvious problem when a virus is spreading.\r\n\r\nHowever, Dr. Sankar Swaminathan, chief of the Infectious Diseases Division at the University of Utah School of Medicine, told Wire Cutter that phones aren\'t a big disease spreader unless they are often handed around from person to person. \r\n\r\nOn that front, AT&T recommended sharing photos online instead of passing a phone to a friend. It also recommended using Bluetooth devices, or hands-free headsets, to take calls so that the phone does not spend much time near your face.\r\n\r\nTo clean phones, Business Insider\'s Shida Feder recommended soap, water, and a damp microfiber cloth. Another option is to use a UV light device that kills germs. \r\n\r\nDon\'t use alcohol or disinfectant, since these substances will damage the protective coating on phone screens.\r\n\r\nKeys\r\nkeys\r\nA set of keys. Jake Liefer via Flickr\r\nSince they are a metal surface, keys can host the coronavirus for 48 hours, according to the advice from Dr. Harries.\r\n\r\nShe suggested in some cases that it could be as long as 72 hours.\r\n\r\nThe best way to keep these clean is to wipe them down after using them with an alcohol solution containing at least 70% alcohol.  \r\n\r\nATMs\r\nA firefighter disinfects an ATM machine to help prevent the spread of the new coronavirus in Tehran, Iran, Thursday, March 5, 2020.\r\nA firefighter disinfects an ATM in Tehran, Iran, March 5, 2020. Vahid Salemi / AP\r\nIn Iran, firefighters disinfected ATMs to try and stop the coronavirus from spreading. But the best thing you can do is either wear gloves while using the machine or thoroughly wash your hands afterward.\r\n\r\nAccording to Wire Cutter, it\'s important to be careful when interacting with ATMs or grocery store pin pads, since they are touched regularly by lots of people in quick succession. If you touch one of these things, wash your hands or sanitize as soon as possible. \r\n\r\nOne way to avoid contact with ATMs altogether is to move to a contactless payment system. \r\n\r\nMoney — including cash and cards\r\nUS currency and credit cards on a table.\r\nUS currency and credit cards on a table. Jenny Kane / AP\r\nAccording to the Federal Reserve, the lifespan of paper cash can be anywhere from four to 23 years. In that time, they can become covered in germs.\r\n\r\nOn the plus side, because it\'s paper, if the coronavirus was on it, it\'s likely it\'d only be active for 24 hours. \r\n\r\nIn China, the government is using ultraviolet light and heat to kill bacteria on cash, and banks were told cash had to be sterilized before being distributed to customers. \r\n\r\nIn early March, the World Health Organization advised people to avoid using cash, and use contactless pay systems like Apple Pay. \r\n\r\nInfection expert Dr. Christine Tait-Burkard from the University of Edinburgh told The Guardian that coins are unlikely to spread the disease.\r\n\r\nAs for credit cards, they could carry the virus if someone coughed on it when it is handed over to make a payment.\r\n\r\nDoor handles\r\nWomen hold a door open as they exit a subway station, Wednesday, March 4, 2020, in New York.\r\nWomen hold a door open as they exit a subway station, Wednesday, March 4, 2020, in New York. Mark Lennihan / AP\r\nTouching door handles, and other similar hard surfaces, has a risk of transmission for up to 72 hours.\r\n\r\nAccording to The Guardian, the best thing to do is be mindful of the surface you touch, and wash your hands. \r\n\r\n \r\n\r\nEscalator handrails\r\nA commuter holds on to an escalator handrail as he exits the World Trade Center transportation hub, Wednesday, March 4, 2020, in New York.\r\nA commuter holds on to an escalator handrail as he exits the World Trade Center transportation hub, Wednesday, March 4, in New York. Mark Lennihan / AP\r\nFor people who are still using public transport and holding onto handrails, the main takeaway is to try not to touch your face.\r\n\r\nEngland\'s chief medical officer Professor Chris Whitty told the public not to touch their faces after touching a handrail, as there was \"some risk of transmission.\"\r\n\r\nWhitty told The Telegraph, \"So, if you go on to the Tube and touch the rail, that\'s fine, but just be aware of what you do with your hands - don\'t touch your face, wash your hands, and then you can do what you like.\"\r\n\r\nCommuting poles\r\nA commuter holds on to a vertical pole as she rides the subway, Wednesday, March 4, 2020, in New York.\r\nA commuter holds on to a vertical pole as she rides the subway, Wednesday, March 4, 2020, in New York. Mark Lennihan / AP\r\nLike handrails, poles on buses and subways are hard surfaces touched by a lot of people.\r\n\r\nAs Professor Whitty said, be aware of what you do with your hands, and don\'t touch your face, until you\'ve washed your hands.  \r\n\r\nLift buttons\r\nTwo women wait for the lift.\r\nTwo women wait for the lift. Tara Todras-Whitehill / AP\r\nLift buttons are a necessity, but like ATMs, a lot of people touch them throughout the day.\r\n\r\nIn China, a number of solutions have arisen to avoid touching the buttons, according to the South China Morning Post. Some people used lighters, pens, or toothpicks to choose a floor, while other buildings use voice-controlled directions. \r\n\r\nBut the most futuristic answer to this problem was the implementation of holographic buttons, by at least one building in Hefei. \r\n\r\nWhile the US doesn\'t appear to have holographic lift buttons in common use yet, tools like toothpicks could work, as long as they\'re thrown away afterward.\r\n\r\nThe other alternative is to not touch your face after touching the lift button, and wash, or disinfect, your hands, as soon as you can. \r\n\r\nCommunal surfaces at work\r\n4sq office kitchen\r\nOffice kitchen. Dan Frommer, Business Insider\r\nThis isn\'t a problem for the large number of people who are now working from home — more than 85% of all Americans have been ordered to stay at home.\r\n\r\nBut for those still going to work, communal surfaces, in office kitchens or work bathrooms, all come into contact with multiple people throughout the day.\r\n\r\nAccording to The Guardian, after doing the tea round you should make sure to sanitize your hands.\r\n\r\nFinally, the best thing you can do is wash your hands, often, and thoroughly.', '2020-09-22 09:33:10', , 1);

