INSERT INTO `virus` (`id`, `name`, `category`, `family`, `vaccine`, `body`, `image`) VALUES
(5, 'Sars', 'Respiratory', '', '', 'Severe acute respiratory syndrome (SARS) is a viral respiratory disease caused by a SARS-associated coronavirus. It was first identified at the end of February 2003 during an outbreak that emerged in China and spread to 4 other countries. WHO co-ordinated the international investigation with the assistance of the Global Outbreak Alert and Response Network (GOARN) and worked closely with health authorities in affected countries to provide epidemiological, clinical and logistical support and to bring the outbreak under control.  SARS is an airborne virus and can spread through small droplets of saliva in a similar way to the cold and influenza. It was the first severe and readily transmissible new disease to emerge in the 21st century and showed a clear capacity to spread along the routes of international air travel.  SARS can also be spread indirectly via surfaces that have been touched by someone who is infected with the virus.  Most patients identified with SARS were previously healthy adults aged 25–70 years. A few suspected cases of SARS have been reported among children under 15 years. The case fatality among persons with illness meeting the current WHO case definition for probable and suspected cases of SARS is around 3%.The incubation period of SARS is usually 2-7 days but may be as long as 10 days.  The first symptom of the illness is generally fever (>38°C), which is often high, and sometimes associated with chills and rigors. It may also be accompanied by other symptoms including headache, malaise, and muscle pain. At the onset of illness, some cases have mild respiratory symptoms. Typically, rash and neurologic or gastrointestinal findings are absent, although a few patients have reported diarrhoea during the early febrile stage.  After 3-7 days, a lower respiratory phase begins with the onset of a dry, non-productive cough or dyspnoea (shortness of breath) that may be accompanied by, or progress to, hypoxemia (low blood oxygen levels). In 10–20% of cases, the respiratory illness is severe enough to require intubation and mechanical ventilation. Chest radiographs may be normal throughout the course of illness, though not for all patients. The white blood cell count is often decreased early in the disease, and many people have low platelet counts at the peak of the disease. ', '1600780001-sars.jpg'),
(6, 'Mers', 'Respiratory', '', '', 'Middle East Respiratory Syndrome (MERS) is an illness caused by a virus (more specifically, a coronavirus) called Middle East Respiratory Syndrome Coronavirus (MERS-CoV). Most MERS patients developed severe respiratory illness with symptoms of fever, cough and shortness of breath. About 3 or 4 out of every 10 patients reported with MERS have died.  All cases are linked to the Arabian Peninsula Health officials first reported the disease in Saudi Arabia in September 2012. Through retrospective (backward-looking) investigations, they later identified that the first known cases of MERS occurred in Jordan in April 2012. So far, all cases of MERS have been linked through travel to, or residence in, countries in and near the Arabian Peninsula. The largest known outbreak of MERS outside the Arabian Peninsula occurred in the Republic of Korea in 2015. The outbreak was associated with a traveler returning from the Arabian Peninsula.  People with MERS can spread it to others MERS-CoV has spread from ill people to others through close contact, such as caring for or living with an infected person.  MERS can affect anyone. MERS patients have ranged in age from younger than 1 to 99 years old.  CDC continues to closely monitor the MERS situation globally. We are working with partners to better understand the risks of this virus, including the source, how it spreads, and how to prevent infections. CDC recognizes the potential for MERS-CoV to spread further and cause more cases globally and in the U.S. We have provided information for travelers and are working with health departments, hospitals, and other partners to prepare for this.', '1600779986-mers.jpg'),
(7, 'Covid 19', 'Respiratory', '', '', 'COVID-19 is a serious global infectious disease outbreak with nearly 550,000 cases and around 25,000 deaths worldwide. It is part of a family of viruses called coronaviruses that infect both animals and people. This particular one originated in China at the end of 2019, in the city of Wuhan, which has 11 million residents. In the past two decades coronavirus outbreaks have caused global concern, including one in 2003 with the Severe Acute Respiratory Syndrome (SARS) and more recently in 2012 with the Middle East Respiratory Syndrome (MERS).  COVID-19 can cause symptoms very similar to the flu – fever and a dry cough (the two most common symptoms), fatigue, aches and pains, and nasal congestion. As the pandemic spread around the world, other symptoms such as a loss of sense of smell or taste have emerged – these are not yet conclusive evidence of infection with the new coronavirus, and the World Health Organization is investigating this.  Severe cases can lead to serious respiratory disease, and even pneumonia. Those most at risk are the elderly, or people with underlying medical issues, such as heart problems or diabetes. According to the most recent global numbers (27 March 2020), 14.8% of people over 80 years old, infected with the virus, have died from it, compared with 0.4% in people aged 40-49% and none in children under 9 years. The situation across countries is rapidly changing and these numbers will continue to change as the pandemic shifts.  Despite most deaths still being in older people, it is clear that many young people with the virus can still develop serious infection that requires hospitalisation.  The evidence so far indicates that the virus is spread from person to person through small respiratory droplets. When a person coughs or sneezes, these droplets can also land on nearby surfaces. There is also evidence that the COVID-19 virus can last on surfaces – especially plastic or metal – for up to 3 days. This is why advice to avoid catching COVID-19 has focused on handwashing with soap, the use of alcohol-based hand sanitising gels and keeping a distance from people who are symptomatic.  While many people can be seen to wear masks, especially on public transport, the World Health Organization (WHO) says that you only need to wear a mask if you are unwell or looking after someone who is sick and is in addition to the important measures above  IS THERE A TREATMENT OR VACCINE? Right now, there are no antivirals or vaccines to treat or prevent COVID-19, although there are at least 44 potential coronavirus vaccines in development. Several antivirals, including those against flu and HIV are being tested to see if they could be used against the new coronavirus, as is chloroquine, a common antimalarial.  Even in an emergency, vaccines can take a long time to develop – no matter how quickly researchers race through the initial phase of identifying candidate vaccines and getting their vaccines into clinical testing. This is because taking the vaccine through the rigorous stages of testing for safety and efficacy can normally take several years. And it is still unclear whether the COVID-19 outbreak will have peaked before a vaccine can be rolled-out.  HOW BAD IS THIS PANDEMIC? COVID-19 is a new coronavirus, which means that it is likely no-one has natural immunity to it. Coronaviruses such as MERS-CoV and SARS are on watchlists of infections with pandemic potential, along with Ebola and influenza. Since it began, COVID-19 has spread worldwide, leading the WHO to label it a pandemic and a “public health emergency of international concern.”  Based on available evidence, COVID-19 appears to have a fatality rate of 4.4%, much lower than 10% for SARS and around 30% for MERS-CoV. Yet this is not a reason to relax containment and control measures.  COVID-19 is more contagious than either SARS or MERS-CoV, and crucially, can be spread undetected. This is because many people with COVID-19 are either asymptomatic or have very mild symptoms, so they may not be adequately isolating themselves, and spreading the infection. Most countries around the world are now on lockdown to avoid spreading the virus any further, and allowing “a flattening of the curve” meaning avoiding cases from spiking and overwhelming health systems.', '1600779959-covid19 (2).jpg'),
(8, 'H1N1', 'Respiratory', '', '', 'H1N1 flu is also known as swine flu. It\'s called swine flu because in the past, the people who caught it had direct contact with pigs. That changed several years ago, when a new virus emerged that spread among people who hadn\'t been near pigs.  In 2009, H1N1 was spreading fast around the world, so the World Health Organization called it a pandemic. Since then, people have continued to get sick from swine flu, but not as many.  While swine flu isn\'t as scary as it seemed a few years ago, it\'s still important to protect yourself from getting it. Like seasonal flu, it can cause more serious health problems for some people. The best bet is to get a flu vaccine, or flu shot, every year. Swine flu is one of the viruses included in the vaccine.  How Do You Catch It? The same way as the seasonal flu. When people who have it cough or sneeze, they spray tiny drops of the virus into the air. If you come in contact with these drops, touch a surface (like a doorknob or sink) where the drops landed, or touch something an infected person has recently touched, you can catch H1N1 swine flu.  People who have it can spread it one day before they have any symptoms and as many as 7 days after they get sick. Kids can be contagious for as long as 10 days.  Despite the name, you can\'t catch swine flu from eating bacon, ham, or any other pork product.  Swine Flu Symptoms These, too, are pretty much the same as seasonal flu. They can include:  Cough Fever Sore throat Stuffy or runny nose Body aches Headache Chills Fatigue Like the regular flu, swine flu can lead to more serious problems including pneumonia, a lung infection, and other breathing problems. And it can make an illness like diabetes or asthma worse. If you have symptoms like shortness of breath, severe vomiting, pain in your belly or sides, dizziness, or confusion, call your doctor or 911 right away.', '1600779805-h1n1.jpg'),
(9, 'Sars Cov 2', 'Respiratory', '', '', 'Abstract In recent years, the prevalence and spread of coronavirus has had a huge impact on global public health. Due to the incomplete understanding of the pathogenic mechanism of the virus, it is difficult for humans to fight against the virus quickly and effectively once the outbreak occurs. In early 2020, a novel coronavirus was discovered in Wuhan, China. Soon after, similar cases were found in other countries around the world, and the number of infected people increased rapidly. So far, the global cumulative number of infected people has exceeded 3 million, and more than 200,000 people have died, which has had a huge impact on global human health and economic development. Every outbreak of disease makes a deep impression on mankind. Herein, we summarize the virology, epidemiology, clinical manifestations, diagnosis, treatment and prevention of SARS-CoV-2, and hope that countries can control the outbreak as soon as possible to minimize the loss.  Background It is known to all that since the twenty-first century, there have been three human pathogenic coronavirus outbreaks, which have caused global transmission, bringing huge challenges to global public health and economic development [1]. They are the Severe Acute Respiratory Syndrome coronavirus (SARS-CoV) in 2003 [2], the Middle East Respiratory Syndrome coronavirus (MERS-CoV) in 2012 [3], and the new coronavirus (Severe Acute Respiratory Syndrome coronavirus2, SARS-CoV-2) in 2019 [4]. At present, there is no specific treatment plan.  In early 2020, a case of novel coronavirus was confirmed in Wuhan, China [4]. Within a short period of time, the number of confirmed cases was increasing, and those infected could develop fever, cough, and even severe respiratory syndrome [5], which quickly drew the attention of the Chinese government [6, 7]. Researchers found that 27 of the 41 initially confirmed cases had had direct contact with a local seafood market in Wuhan, initially assuming that the new coronavirus might have come from wild animals sold in the market [8]. Gao et al. collected alveolar lavage fluid from three infected patients and successfully isolated the new coronavirus [9]. Electron microscopy has showed that the virus has an envelop, the particles are round or oval with the diameter of about 60–140 nm [4]. Whole genome sequencing analysis has showed that the virus belongs to a new type of coronavirus of the β genus [4]. In addition, Shi et al. obtained almost identical genome-wide sequences in virus samples from 5 patients. The sequence of the new coronavirus was 79.5% similar to SARS-CoV and 96% similar to the coronavirus carried by bats, which might be the potential source of infection [10]. Another study found that the receptor binding domain of SARS-CoV-2 was the closest to the coronavirus carried by pangolins. Thus, the origin of SARS-CoV-2 remains to be determined [11].', '1600779782-scov2.jpg'),
(19, 'Ebola', 'Hepatic', 'Filoviridae', 'Not Developed', '', '1600847229-ebola.jpg');

